import "./ExpenseItem.css";

function ExpenseItem(props) {
  const day = props.date.toLocaleString('en-US', {day: 'long'});
  const month = props.date.toLocaleString('en-US', {month: '2-digit'});
  const year = props.date.getFullYear()('en-US', {year: 'long'});

  return (
    <div className="expense-item">
      <div> 
        <div>{day}</div>
        <div>{month}</div>
        <div>{year}</div>
      </div>
      <div>{props.date.toLocaleString('en-US', {day: 'long'})}</div>
      <div className="expense-item__description">
        <h2>{props.title}</h2>
        <div className="expense-item__price">{props.amount}</div>
      </div>
    </div>
  );
}
export default ExpenseItem;
